import React from 'react'
import styled from 'styled-components'

function Signup() {
  return (
    <Container>
      
      <Logo>
        <img src="logotry1.jpg" alt="" />
    </Logo>
    <FormContainer>
        <h3>Sign-Up</h3>
        <InputContainer>
        <p>Full Name</p>
        <input type="text" placeholder="John Smith"/>
        </InputContainer>
        <InputContainer>
        <p>Email</p>
        <input type="email" placeholder="example@example.com"/>
        </InputContainer>
        <InputContainer>
        <p>Password</p>
        <input type="password" placeholder='*********'/>
        </InputContainer>
        <SignUpButton>
        Create Account in AnnaJones
         </SignUpButton>
        
    </FormContainer>
    
    </Container>
  )
}
const Container=styled.div`
    width:40%;
    min-width:450px;
    height:fit-content;
    padding:15px;
    margin:auto;
    display:flex;
    flex-direction:column;
    align-items:center;

`;

const Logo =styled.div`
    width:120px;
    margin-bottom:20px;

    img{
        width:100%;
    }

`;

const FormContainer =styled.form`
    border:1px solid lightgray;
    width:55%;
    height:400px;
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    padding:15px;

    h3{
        font-size:28px;
        font-weight:400;
        line-height:0px;
        align-self:flex-start;
    }

`;
const InputContainer =styled.div`
    width:100%;
    padding:10px;
    p{
        font-size:14px;
        font-weight:600;
    }

    input{
        width:95%;
        height:33px;
        padding-left:5px;
        border-radius:5px;
        border:1px solid lightgray;
        margin-top:5px;

        &:hover{
            border:1px solid black;
        }
    }

`;


const LoginButton =styled.button`
    width:70%;
    height:40px;
    background-color:#f3b414;
    border:none;
    outline:none;
    border-radius:10px;
    margin-top:10px;


`;
const InfoText = styled.p`


`;

const SignUpButton = styled.button`
    width:70%;
    hight:45px;
    font-size:12px;
    margin-top:30px;


    &:hover{
        background-color:#dfdfdf;
        border:1px solid darkgray;
    }
`;



export default Signup
